import styled from "styled-components";

const StoreItem = (img, name, rating) => {
    return (
        <StoreContainer>
            <StoreImg />
            <TextContainer>
                <StoreNameTxt>{name}</StoreNameTxt>
                <StoreRatingTxt>{rating}</StoreRatingTxt>
            </TextContainer>
        </StoreContainer>
    );
}


const StoreContainer = styled.div`
    display: flex;
    flex-direction: column;
    width: 260px;
`;

const StoreImg = styled.img`
    width: 260px;
    height: 200px;
`;

const TextContainer = styled.div`
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    margin-top: 13px;
`;

const StoreNameTxt = styled.div`
    color: #61677A;
    font-size: 20px;
    margin-left: 10px;
    font-weight: 800;
`;

const StoreRatingTxt = styled.div`
    color: #61677A;
    margin-right: 10px;
    font-weight: 800;
`;

export default StoreItem;
